import './App.css';

import Navbar from "./components/Navbar.js";
import MainPage from "../src/page/MainPage.js"
import SignSelect from "./pages/SignSelect.js";

import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <BrowserRouter basename ='/Handycam'>
        <Navbar />

        <Routes>
          <Route path='/' element={<MainPage />}></Route>
          <Route path ='/SingSelect' element={<SignSelect/>}></Route>
        </Routes>



      </BrowserRouter>


    </div>
  );
}

export default App;
